Além de suas propriedades de informações de fornecedor e versão do navegador, o objeto Navigator 
tem algumas propriedades e métodos variados. As propriedades padronizadas e não padrão mas 
amplamente implementadas incluem:
onLine
A propriedade navigator.onLine (se existe) especifica se o navegador está conectado na rede. 
Os aplicativos talvez queiram salvar o estado localmente (usando técnicas do Capítulo 20), 
enquanto estão off-line.
